import SideBar from "../../Components/SideBar";
import { PerfilStyle } from './styles'

function Perfil() {
    return (
        <>
            <SideBar selected="perfil" />
            <PerfilStyle>
                <div className="container">
                    <div className="content">
                        <div>
                            <img src="" alt="" />
                        </div>

                        <div>
                            <input type="text" />
                            <input type="text" />
                            <input type="text" />
                            <input type="text" />                            
                        </div>

                    </div>
                </div>
            </PerfilStyle>
        </>
    );
}

export default Perfil;
